import "../Style/dashboard.css"
import $ from 'jquery';



const dashOpen = () => {
    $('.dashOpen').addClass("open")


};

function dashboard() {

    return (
        <div className="dashboard">
            <div className="dashOpen" onClick={dashOpen}></div>
        </div>
    );
}

export default dashboard;
